import React from 'react';
import { connect } from 'react-redux';
import { Redirect, Route } from 'react-router';

const PublicRouter = ({ isAuthenticated, component: Component, ...rest }) => {
    return (
        <Route
            {...rest}
            component={(props) => isAuthenticated ? (<Redirect to="/Notes" />) : ( <Component {...props} />)}
        />
    );
};
const mapStateToProps = (state) => {
    return {
        isAuthenticated:!!state.userData.ownerId,
    };
};

export default connect(mapStateToProps, '')(PublicRouter);
